29	Attack on Titan	An anime which is jam-packed with fast-paced episodes; head-spinning plot twists, that will shock even Game of Throne enthusiasts; and intricately designed characters.	Movie	data:image/jpeg;base64,	Overall, this is an entirely captivating, enthralling and thrilling series.\n\nAttack on Titan follows protagonist Eren Yeager in a world where humans live within the safety of 3 circular fifty-metre¹ high walls. Safe from the man-eating titans (deformed giants with human appearances normally between 3–15 metres tall) that kill humans mercilessly out of pleasure. Eren is forced into the world of nightmares when his outer-city, Shiganshina, and the outer ring wall (wall Maria) is shockingly breached by the unknown colossus Titan (60 metres tall) and the armoured titan. He is determined to eradicate titans and reclaim their land, accompanied by his adopted sister Mikasa Ackerman — charged to keep Eren safe — and his bestfriend Armin Arlert. Their journey together takes them down many dangerous and perilous paths, learning truths they wished were false. It’s a constant race between life and death, with many characters you meet not making it past an episode, and some you sit anxiously on the edge of your seat hoping they will.\n\nThe Attack on Titan anime is based on the Japanese Manga series Shingeki no Kyojin written and drawn by the mastermind and author Hajime Isayama. Comparing the anime to the manga, you’ll find it fairly close. There are 27 volumes (as of December 2018) of this manga series (each containing four episodes each) and is the largest manga in print with 86 million copies² printed with just under 9% of that printed worldwide. The anime was created in 2013 and is licensed with Funimation³. This series has 3 seasons to date and has 12 more episodes due to be released in April 2019⁴ taking the total number of episodes up to 61.\nThis anime is jam-packed with fast-paced episodes; head-spinning plot twists, that will shock even Game of Throne enthusiasts; and intricately designed characters. Though episodes speed along there are times when it does slow down, giving enough time to catch your breath.\n\nAttack on Titan is incredibly detailed. Even the side stories twist and turn, the plot seeming to change with every episode. There is just no watching them fast enough and with each episode running for about 20 minutes, it’s incredibly easy to binge.\n\nSomething that stuck out, was the snippets of detail that allow the audience some special context with specific relevance to this created world; from the information about the structuring of the three walls (wall Maria, wall Rose and wall Sina where mankind has lived safely for 107 years), to the details of how the Vertical Manoevering Equipment works (equipment used by the military to fight the titans), to other mechanical technicalities. This cleverly allows the audience and the reader to learn alongside the characters and easily encourages them to delve deeper into this world.\n\nI did find that there are times when the characters have more emotion than I expected and wanted them to have. These parts of over emotion do provide insight into these characters own vulnerability. The men being more emotional than the women. It’s a great series promoting women power.	2021-05-16 17:38:51.456306	\N	11	f	\N
28	Audi to launch the Next-Gen A8 in India	Audi A8 gets its facelift 2020 and it is going to have a longer wheelbase version with a sole petrol engine.	Automotive	data:image/jpeg;base64,	It was reported earlier that Audi would be launching their flagship A8 luxury sedan in India towards the end of 2019. Sadly, due to slowdown in the automotive industry, Audi had to delay the launch. Now, Audi will be finally launching the A8 sedan in India in February 2020, as has been informed by Balbir Singh Dhillon, head, Audi India.\n\nThe Audi A8 is currently in its fourth generation and it was unveiled globally in 2017. It really took a long time for Audi to launch this new generation A8 in India. Audi has been testing the new-gen A8 in India for quite some time now as we have seen several spy images of a camouflaged A8 on Indian roads. The international-spec A8 continues to be available in standard (A8) and long-wheelbase (A8 L). Like has always been the case with the A8 in India, we will be getting the long-wheelbase version in India. It has grown 37mm longer and 17mm taller than the outgoing model.\n\nLike any other Audi sedan, the design of the new A8 is simple and understated. The real style lies in the detailing like the massive single frame chrome grille on the face or the new HD matrix LED headlamps. The face is bold and upright, there’s a high shoulder line with a flat roof dome and the rear is gently inclined. The OLED technology on the rear tail lamps also looks particularly attractive.\n\nThis being the flagship Audi sedan, the A8 comes absolutely loaded with fancy gizmos and technology on the inside. The dashboard is now dominated by two large touchscreens – one for the infotainment and the other for the climate control and various other vehicle settings. There’s absolute minimal use of physical buttons and and the gloss black panels along with the wood trims blend in very well. The virtual cockpit in the instrument cluster is a standard fitment.\n\nInternationally, the A8 is available with a range of engine options – a 3.0-litre V6 turbo-petrol and diesel engines putting out 340hp and 286hp respectively, serve as entry-level power units. A 460hp, twin-turbocharged petrol V8 and a 459hp plug-in hybrid. In India, Audi will be offering the A8 with the 3.0L, V6, turbo-petrol engine. Audi plans to discontinue diesel engines post BS-6 norms in India and it is unlikely that the A8 will get a diesel engine in India.	2021-05-16 17:12:42.301558	2021-05-16 20:00:16.417521	10	f	\N
30	10 cool experiences from Colombo, Sri Lanka	My Travel tale to Colombo	Travel	data:image/jpeg;base64,	It is 2021 and Sri Lanka, which I visited in January 2020 (on a sponsored blogging trip) still remains my last international travel! I am thankful for a lot of things but how I wish I could start traveling again without a care in the world! But I guess that has to wait for sometime more. From April 1 India is offering vaccination to common public above 45 and looks like my turn will come soon! But I decided to write about my past trips, while I am waiting patiently to travel again! And I have plenty to share. So here I go about my 10 cool experiences in Colombo!\n\n10. Watching the Sunrise\n\nI was staying at the Movenpick Colombo and they have gorgeous with a bar and pool at the rooftop. Even though I am not an early riser, I set up my alarm for just before sunrise and went to soak in the beauty of the city early in the morning.\n\n\n9. Traveling to Mt. Lavinia by a Train and Eating at Sugar Beach\n\nI took a train from Colombo to Mt. Lavinia, a sea side resort town close to Colombo. The train follows the coast and stops at every other station. Locals take the train in large numbers, but it is popular with tourists too. That is where I met Karina and we had quite an adventure. On the beach is a popular shack known as ‘Sugar Beach.’ Do try it out. If you eat fish, you are at the right place. I am a vegetarian and their pumpkin salad was yum too.\n\n\n8. Paradise Road, Colombo\n\nIf you would like to shop for curios and other local stuff, check out the Paradise Road store. It is full of cute things. I picked up a beautiful blue and white polka dot ceramic mug but alas it did not last long at my home!\n\n\n7. The Design Collective\n\nIf you like to shop for clothes and accessories, do check out the Design Collective. It has an eclectic mix of Sri Lankan and Indian designers under an elegant roof.\n\n\n6. Tea Tasting\n\nSri Lanka is home to exotic varieties of tea. If possible, go for a tea tasting session. Mine was organized at the Movenpick itself and featured a wide variety of tea by Basilur. It was paired with mouth watering snacks and the whole experience was amazing.\n\n\n5. Visit Buddhi Batik\n\nIf you like batik and would like to check out a prominent local design house, do visit Buddhi Batik. They take the traditional batik designs and turn them into contemporary fashion wear.\n\n\n4. Black Cat Cafe, Colombo\n\nIf you are craving cafe style food do check out Black Cat Cafe. It is housed in an old colonial style bungalow and they do rent out a few rooms upstairs via airbnb. They have a relaxed vibe, where you would love to lounge around. Their burgers are good, so is the coffee!\n\n\n3. Visit the Pendi Design Store\n\nIf you would love to explore Sri Lankan Designers and products, go to the Pendi store. They feature a lot of cute products and showcase the local design talent. This place is like a treasure trove, it is difficult to walk out without buying something.\n\n\n2. The Park Street, Colombo\n\nIf you are looking for beer, good food and fun vibes, hop over to the Park Street over the weekend. I went there both on Saturday and Sunday nights. The party vibes were completely missing on the Sunday night but the food was as good as ever!\n\n\n1. Tuk Tuk Safari\nThese dashing young men were the tuk tuk drivers from the Tuk Tuk Safari company and they took us around Colombo in style. Their tuk tuk had a cooler with beer, soft drinks and water! They took us to the narrow lanes, local coffee and spice shops and historic spots. They doubled as tour guides for our group. I would highly recommend the tuk tuk experience in Colombo.	2021-05-16 20:08:24.451609	2021-05-17 10:21:36.313766	10	f	\N
31	Idli: A short recipie	A light, lucious and healthy snack	Food	data:image/jpeg;base64,	How to make Idli\n\n\nStep 1 Soak the rice & dal and grind into a paste & combine\nTo prepare this popular South Indian recipe, wash rice and urad dal separately until the water runs clean and add fenugreek seeds to the rice. Soak it in water for 4-6 hours. Soak the urad dal too for the same amount of time. Drain all the water from the urad dal and grind it to a fine paste. Add water accordingly. Grind the rice to a coarse paste (add water as needed) and then mix both the pastes together in a large bowl and whisk them well. Make sure that the consistency is thick.\n\nStep 2 Let the batter ferment, then add salt\nNow, the idli batter needs to be well-fermented. This step is very important to get soft and fluffy idlis. Keep the batter in a warm place to ferment. Once the batter has risen, add salt to it and whisk to mix it well.\n\nStep 3 Transfer the idli batter in the idli stand\nGrease the idli stand with oil and take a ladleful of batter and fill the idli mould. Add ½ cup of water in the idli steamer and let it boil. Put the idli stand inside and close the lid. Let the steam build for 8-10 minutes before switching off the gas.\n\nStep 4 Wait for the utensil to cool a bit before scooping the idlis out\nIf you are using a cooker, use it without a vent and steam it for 10 minutes and then switch the gas off. In both cases, wait till the steam is released before you take the idli stand out. Wait for another 5 minutes and then use a sharp knife to scoop the idlis out. Serve warm with coconut chutney and sambhar.	2021-05-16 23:34:44.153847	2021-05-17 11:54:48.135822	10	f	\N
